  INSERT INTO `tb_question` VALUES (381, 'QT202004080030', 'SL202004080003', 'radio', '记 忆 力', '无痴呆CDR=0 :  无记忆力缺损或只有轻度不恒定的健忘&-&0.0@-@可疑痴呆CDR=0.5 :  轻度、持续的健忘；对事情能部分回忆，属“良性”健忘&-&0.5@-@轻度痴呆CDR=1.0 : 中度记忆缺损；对近事遗忘突出，有碍日常活动的记忆缺损&-&1.0@-@中度痴呆CDR=2.0 : 严重记忆缺损；能记住过去非常熟悉的事情，新材料则很快遗忘&-&2.0@-@重度痴呆CDR=3.0 : 严重记忆丧失；仅存片断的记忆&-&3.0', NULL, 1, 1, '', 1, NULL, '2020-4-8 15:41:28', '2020-4-8 15:41:28');
  INSERT INTO `tb_question` VALUES (382, 'QT202004080031', 'SL202004080003', 'radio', '定 向 力', '无痴呆CDR=0 : 能完全正确定向&-&0.0@-@可疑痴呆CDR=0.5 : 除时间定向有轻微困难外，能完全正确定向&-&0.5@-@轻度痴呆CDR=1.0 : 时间定向有中度困难；对检查的地点能定向；在其他地点可能有地理性失定向&-&1.0@-@中度痴呆CDR=2.0 : 时间定向有严重困难；通常对时间不能定向，常有地点失定向&-&2.0@-@重度痴呆CDR=3.0: 仅有人物定向&-&3.0', NULL, 1, 1, '', 1, NULL, '2020-4-8 15:41:28', '2020-4-8 15:41:28');
  INSERT INTO `tb_question` VALUES (383, 'QT202004080032', 'SL202004080003', 'radio', '判断力+解决问题能力', '无痴呆CDR=0 : 能很好解决日常问题、处理职业事务和财务；判断力良好，与过去的水平有关&-&0.0@-@可疑痴呆CDR=0.5 ： 在解决问题、判别事物间的异同点方面有轻微缺损&-&0.5@-@轻度痴呆CDR=1.0 ： 在解决问题、判别事物间的异同点方面有中度困难；社会判断力通常保存&-&1.0@-@中度痴呆CDR=2.0 ：在解决问题、判别事物间的异同点方面有严重损害；社会判断力通常受损&-&2.0@-@重度痴呆CDR=3.0 ：不能做出判断，或不能解决问题&-&3.0', NULL, 1, 1, '', 1, NULL, '2020-4-8 15:41:28', '2020-4-8 15:41:28');
  INSERT INTO `tb_question` VALUES (384, 'QT202004080033', 'SL202004080003', 'radio', '社会事务', '无痴呆CDR=0 :  在工作、购物、志愿者和社会团体方面独立的水平与过去相同&-&0.0@-@可疑痴呆CDR=0.5 ：在这些活动方面有轻微损害&-&0.5@-@轻度痴呆CDR=1.0 ：虽然可能还参加但已不能独立进行这些活动；偶尔检查是正常&-&1.0@-@中度痴呆CDR=2.0 ：不能独立进行室外活动；但可被带到室外活动&-&2.0@-@重度痴呆CDR=3.0 ：不能独立进行室外活动；病重得不能被带到室外活动&-&3.0', NULL, 1, 1, '', 1, NULL, '2020-4-8 15:41:28', '2020-4-8 15:41:28');
  INSERT INTO `tb_question` VALUES (385, 'QT202004080034', 'SL202004080003', 'radio', '家庭+爱好', '无痴呆CDR=0 :  家庭生活、爱好和需用智力的兴趣均很好保持&-&0.0@-@可疑痴呆CDR=0.5 ：家庭生活、爱好和需用智力的兴趣轻微受损&-&0.5@-@轻度痴呆CDR=1.0 ：家庭活动轻度障碍是肯定的，放弃难度大的家务，放弃复杂的爱好和兴趣&-&1.0@-@中度痴呆CDR=2.0 ：仅能作简单家务，兴趣保持的范围和水平都非常有限&-&2.0@-@重度痴呆CDR=3.0 ：丧失有意义的家庭活动&-&3.0', NULL, 1, 1, '', 1, NULL, '2020-4-8 15:41:28', '2020-4-8 15:41:28');
